Ao entrar em execução, a função `DllMain` é chamada com base nas razões especificadas pelo parâmetro `ul_reason_for_call`. No exemplo acima, nossa função é chamada quando o processo é anexado (`DLL_PROCESS_ATTACH`) ou quando um novo thread é criado (`DLL_THREAD_ATTACH`).

