using System;
using System.Collections.Generic;
using System.Linq;
using Xamarin.iOS;

public class LocationTracker
{
    private Geolocator geolocator;

    public LocationTracker()
    {
        // Initialize the geolocator with a delegate that will be called when a location is obtained. 
        geolocator = new Geolocator(delegate(CLLocation loc)
        {
            // Call the delegate with the current location, which includes the latitude and longitude of the device.
            Console.WriteLine($"Latitude: {loc.Coordinate.Latitude}, Longitude: {loc.Coordinate.Longitude}");
        });
    }

    public void Start()
    {
        // Request authorization to use location services. 
        geolocator.RequestAuthorization();

        // Start updating the location, which will continue until the app is closed or the user revokes permission. 
        geolocator.StartUpdatingLocation();
    }

    public void Stop()
    {
        // Stop updating the location. This will not affect any previously obtained locations. 
        geolocator.StopUpdatingLocation();
    }
}
